function imgui.Link(link,name,myfunc)
    myfunc = type(name) == 'boolean' and name or myfunc or false
    name = type(name) == 'string' and name or type(name) == 'boolean' and link or link
    local size = imgui.CalcTextSize(name)
    local p = imgui.GetCursorScreenPos()
    local p2 = imgui.GetCursorPos()
    local resultBtn = imgui.InvisibleButton('##'..link..name, size)
    if resultBtn then
        if not myfunc then
            os.execute('explorer '..link)
        end
    end
    imgui.SetCursorPos(p2)
    if imgui.IsItemHovered() then
        imgui.TextColored(imgui.ImVec4(1.20, 0.33, 0.29, 1.00), name)
        imgui.GetWindowDrawList():AddLine(imgui.ImVec2(p.x, p.y + size.y), imgui.ImVec2(p.x + size.x, p.y + size.y), imgui.GetColorU32(imgui.ImVec4(0.20, 0.33, 0.29, 1.00)))
    else
        imgui.TextColored(imgui.ImVec4(0.20, 0.33, 0.29, 1.00), name)
    end
    return resultBtn
end

function explode_argb(argb)
  local a = bit.band(bit.rshift(argb, 24), 0xFF)
  local r = bit.band(bit.rshift(argb, 16), 0xFF)
  local g = bit.band(bit.rshift(argb, 8), 0xFF)
  local b = bit.band(argb, 0xFF)
  return a, r, g, b
end

function join_argb(a, r, g, b)
  local argb = b
  argb = bit.bor(argb, bit.lshift(g, 8))
  argb = bit.bor(argb, bit.lshift(r, 16))
  argb = bit.bor(argb, bit.lshift(a, 24))
  return argb
end

function getMyMoney()
	local a, d = ('%d'):format(tostring(getPlayerMoney(PLAYER_HANDLE))):gsub('^%-', '')
	local b = a:reverse():gsub('%d%d%d', '%1.')
	local c = b:reverse():gsub('^%.', '')
	return (d == 1 and '-' or '')..c
end

function myAmmo()
  return memory.getint32(getCharPointer(PLAYER_PED) + 0x5A0 + memory.getint8(getCharPointer(PLAYER_PED) + 0x0718, false) * 0x1C + 0x8, false)
end

function renderFigureCircle(x, y, points, radius, scale, texture, tX, tY, tSX, tSY, color)
  local step = points / 1000
  local render_start, render_end = {}, {}
  renderDrawPolygon(x - 2.75, y - 2.75, 15, 15, points, 0, 0xFF211F1D)
  renderDrawPolygon(x - 2.75, y - 2.75, 47, 47, points, 0, 0xFF110F0D) --Circulo de fondo negro tamaÃ±o
  for i = -step, -scale * step, -step do
    render_start[1] = -radius * math.sin(i + step) + x
    render_start[2] = -radius * math.cos(i + step) + y
    render_end[1] = -radius * math.sin(i) + x
    render_end[2] = -radius * math.cos(i) + y
    renderDrawLine(render_start[1], render_start[2], render_end[1], render_end[2], 3.5, color) --Grosor de linea 
  end
	renderDrawTexture(texture, tX, tY, tSX, tSY, 0, color) -- Rotacion de iconos
end

function saveSettings()
  if doesFileExist(fpath) then
		local f = io.open(fpath, 'w+')
	  if f then
	    f:write(encodeJson(defTable)):close()
	  end
  end
end

function onScriptTerminate(s, quitGame)
	if s == script.this then
		displayHud(true)
		showCursor(false, false)
		saveSettings()
	end
end

